import React from 'react'
import { Button, Form, Col, Row } from 'react-bootstrap';
import logo from '../../images/signup.png'
import { faPen } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function Profile() {
    let title = ["Your name", "Your email address", "Your phone number"]
    let items = [];
    for (let number = 1; number <= 3; number++) {
        items.push(
            <Form.File.Label>
                {title[number-1]}
                <a href="#"><FontAwesomeIcon icon={faPen} />Edit</a><br />
                {number}
            </Form.File.Label>
        );
        items.push(<br />)
        items.push(<br />)
    }

    let others = ["Your default currency", "Your time zone", "Language"]
    let other_items = [];
    for (let number = 1; number <= 3; number++) {
        other_items.push(
            <Form.Group controlId="exampleForm.ControlSelect1">
                <Form.Label>{others[number]}</Form.Label>
                <Form.Control as="select">
                <option>1</option>
                <option>2</option>
                <option>3</option>
                <option>4</option>
                <option>5</option>
                </Form.Control>
            </Form.Group>
        );
        other_items.push(<br />)
    }

    return (
        <>
        <Row className="justify-content-md-center">
            <Col sm={4}>
                <img src={logo} style={{width: "50%"}}/>
                <div className="mb-3" style={{paddingLeft: "40px"}}>
                    <Form.File id="formcheck-api-regular">
                    <Form.File.Label>Regular file input</Form.File.Label>
                    <Form.File.Input />
                    </Form.File>
                </div>
            </Col>
            <Col sm={3}>
                <Form.Group>
                    {items}
                </Form.Group>
            </Col>
            <Col sm={3}>
                <Form.Group>
                    {other_items}
                </Form.Group>
            </Col>

        </Row>
        </>
    )
}

export default Profile
